function Currentdetails ({e}){
    console.log(e.location.name);

    console.log(e.current.temp_c);
   
 return (
    <div style={{justifyContent:"center",textAlign:"center",boxShadow:"rgba(0, 0, 0, 0.4) 0px 30px 90px",color:"blue.300"}}>
        <div>
            <h1>Felt Temp.</h1>
            <h1>Humidity</h1>
            <h1>Wind</h1>
            <h1>Visibility</h1>
            <h1>Temp.</h1>
          
        </div>
        <div >
            <h1>{e.current.feelslike_c}<sup>o</sup>C</h1>
            <h1>{e.current.humidity}%</h1>
            <h1>{e.current.wind_kph}Km/h</h1>
            <h1>{e.current.vis_km}Km</h1>
            <h1>{e.current.temp_c}<sup>o</sup>C</h1>
           
        </div>
    </div>
 )
}

export default Currentdetails;
